import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import './Navbar.css';
import $ from 'jquery';

import { Link } from 'react-router-dom';

export default class GrcNavbar extends Component {
  componentDidMount () {
    $("#navbarMenu ul .submenu > a").append('<span class="submenu-button"></span>');

//OPEN TOGGLE MENU ON BREAKPOINT MEDIA QUERY
$(".toggleMenu").click(function(e){
    $("nav > ul").slideToggle();
    e.preventDefault();
});

//TO PREVENT MENU CLOSE ON CLICK IN SUBMENU
$(".submenu ul li").click(function(e){
    e.stopPropagation();
});

//CLICK ON SUBMENU LINK
$(".submenu").click(function(e){
    //CLOSE OPEN SUBMENU
    if($(this).hasClass("active")){
        $("#navbarMenu ul li").removeClass('active');
        $('#navbarMenu ul li ul').slideUp();
    }else{
        $("#navbarMenu ul li").removeClass('active');
        $("#navbarMenu ul li ul").slideUp();
        $(this).addClass("active");
        $(this).find('ul').stop().slideToggle();
        e.stopPropagation();
    }
    $("#navbarMenu ul li").removeClass('openSub');
    $(this).addClass('openSub');

});

$("body, html").click(function(){
    $("#navbarMenu ul li").removeClass('active openSub');
    $('#navbarMenu ul li ul').slideUp();
});
  }
  render() {
    return (
      <nav className="with-dropdown navbar navbar-static-top navbar-default navbar-semi-transparent navbar-highlight-factory-yellow" role="navigation">
        <div className="container">
          <div className="navbar-header">
            <button type="button" className="navbar-toggle collapsed" data-toggle="collapse" data-target="#bs-example-navbar-collapse-2">
              <span className="sr-only">Toggle navigation</span>
              <span className="icon-bar" />
              <span className="icon-bar" />
              <span className="icon-bar" />
            </button>
            <ul className="nav">
              <li className="dropdown">
                <a href="#" className="dropdown-toggle" data-toggle="dropdown" role="button" aria-expanded="false">
                  <img className="navbar-user-img img-circle" src="https://graph.facebook.com/66200111/picture?width=64&height=64" />
                </a>
                <ul className="dropdown-menu dropdown-menu-right" role="menu">
                  <li><a href="#">Account</a></li>
                  <li><a href="#">Log out</a></li>
                </ul>
              </li>
            </ul>
            <a className="navbar-brand" href="#">
              <span className="navbar-logo">Spotify</span>
            </a>
          </div>
          <div className="collapse navbar-collapse" id="bs-example-navbar-collapse-2">
            <ul className="nav navbar-nav navbar-right">
              <li><a href="#">What is Spotify?</a></li>
              <li><a href="#">Premium</a></li>
              <li className="active"><a href="#">Help</a></li>
              <li><a href="#">Download</a></li>
              <li role="separator" className="divider hidden-xs hidden-sm" />
              <li className="alternate hidden-xs hidden-sm"><a href="#">Upgrade</a></li>
              <li className="dropdown alternate hidden-xs hidden-sm">
                <a href="#" className="dropdown-toggle" data-toggle="dropdown" role="button" aria-expanded="false">
                  <img className="navbar-user-img img-circle" src="https://graph.facebook.com/66200111/picture?width=64&height=64" /> Jillian Nichols
                  <svg className="svg-chevron-down" viewBox="0 0 1024 1024">
                    <path className="path1" d="M476.455 806.696l-381.164-381.164q-14.621-14.621-14.621-35.293t14.621-34.789 35.293-14.117 34.789 14.117l342.846 343.35 349.4-349.4q14.621-14.117 35.293-14.117t34.789 14.117 14.117 34.789-14.117 34.789l-381.164 381.164q-19.159 19.159-38.318 19.159t-31.764-12.605z" />
                  </svg>
                </a>
                <ul className="dropdown-menu dropdown-menu-right" role="menu">
                  <li><a href="#">Account</a></li>
                  <li><a href="#">Log out</a></li>
                </ul>
              </li>
            </ul>
          </div>
        </div>
      </nav>
    )
  }
}
